function home() {


    return (
        <body>
            <div class="navbar">
            <a class="navlogo"> Logo </a>
            <div class="navlinkwrap">
                <span class="navlink selectedlink">Home</span>
                <span class="navlink">About</span>
            </div>
            <div class="buttonwrap">
                <button class="createbtn selectedbtn">EA PRODUCT</button>
                <button class="createbtn">SIGN IN</button>
            </div>
            </div>
            <div class="landingpage">

            </div>
        </body>
    );
  }

  export default home;
